export default function ArchivePageInfoSchema({ info }) {

    return (
        <>
        <p className="consistencyInfo">
            {info.map(consistenza => {
                <>
                <b>{consistenza.inventoryitemname}:</b>
                <p>{consistenza.itemQuantity}</p>
                </>
            })}
        </p>
        <p className="chronologyInfo"></p>
        <p className="referenceToolInfo"></p>
        </>
    );
}
